patch:
--- include/LoadBalancer.hpp
@@ -14,6 +14,7 @@
 #include <int128_t.hpp>
 #include <OmpLock.hpp>
 #include <Status.hpp>
+#include <noinline.hpp>

 #include <stdint.h>

@@ -36,8 +37,8 @@ struct ThreadSettings
 class LoadBalancer
 {
 public:
-  LoadBalancer(maxint_t x, int64_t sieve_limit, maxint_t sum_approx);
-  bool get_work(ThreadSettings& thread);
+  NOINLINE LoadBalancer(maxint_t x, int64_t sieve_limit, maxint_t sum_approx);
+  NOINLINE bool get_work(ThreadSettings& thread);
   maxint_t get_sum() const;

 private:
--- include/LoadBalancerP2.hpp
@@ -13,15 +13,16 @@
 #ifndef LOADBALANCERP2_HPP
 #define LOADBALANCERP2_HPP

+#include <noinline.hpp>
 #include <stdint.h>

 namespace primecount {

 class LoadBalancerP2
 {
 public:
-  LoadBalancerP2(int64_t z, int threads);
-  int64_t get_thread_dist(int64_t low);
+  NOINLINE LoadBalancerP2(int64_t z, int threads);
+  NOINLINE int64_t get_thread_dist(int64_t low);
   int get_threads() const;

 private:
--- include/PiTable.hpp
@@ -18,6 +18,7 @@

 #include <popcnt.hpp>
 #include <aligned_vector.hpp>
+#include <noinline.hpp>
 #include <pod_vector.hpp>

 #include <stdint.h>
@@ -36,7 +37,12 @@ namespace primecount {
 class PiTable
 {
 public:
-  PiTable(uint64_t limit, int threads);
+  NOINLINE PiTable(uint64_t limit, int threads);
+
+  int64_t size() const
+  {
+    return limit_ + 1;
+  }

   /// Get number of primes <= n
   int64_t operator[](uint64_t n) const
@@ -56,11 +62,6 @@ class PiTable
     return prime_count + bit_count;
   }

-  int64_t size() const
-  {
-    return limit_ + 1;
-  }
-
 private:
   struct pi_t
   {
--- include/SegmentedPiTable.hpp
@@ -43,13 +43,22 @@ namespace primecount {
 class SegmentedPiTable
 {
 public:
-  SegmentedPiTable(uint64_t limit,
-                   uint64_t segment_size,
-                   int threads);
-
+  NOINLINE SegmentedPiTable(uint64_t limit,
+                            uint64_t segment_size,
+                            int threads);
   NOINLINE void init();
   void next();

+  int64_t low() const
+  {
+    return low_;
+  }
+
+  int64_t high() const
+  {
+    return high_;
+  }
+
   /// Get number of primes <= n
   int64_t operator[](uint64_t n) const
   {
@@ -70,16 +79,6 @@ class SegmentedPiTable
     return prime_count + bit_count;
   }

-  int64_t low() const
-  {
-    return low_;
-  }
-
-  int64_t high() const
-  {
-    return high_;
-  }
-
 private:
   void init_bits(uint64_t start, uint64_t stop, uint64_t thread_num);
   void init_prime_count(uint64_t start, uint64_t stop, uint64_t thread_num);
--- include/Sieve.hpp
@@ -48,12 +48,12 @@ struct Wheel
 class Sieve
 {
 public:
-  Sieve(uint64_t low, uint64_t segment_size, uint64_t wheel_size);
+  NOINLINE Sieve(uint64_t low, uint64_t segment_size, uint64_t wheel_size);
+  NOINLINE void cross_off(uint64_t prime, uint64_t i);
+  NOINLINE void cross_off_count(uint64_t prime, uint64_t i);
   static uint64_t get_segment_size(uint64_t size);
   uint64_t count(uint64_t start, uint64_t stop) const;
   uint64_t count(uint64_t stop);
-  NOINLINE void cross_off(uint64_t prime, uint64_t i);
-  NOINLINE void cross_off_count(uint64_t prime, uint64_t i);

   uint64_t get_total_count() const
   {
--- include/Status.hpp
@@ -18,7 +18,7 @@ namespace primecount {
 class Status
 {
 public:
-  Status(maxint_t x);
+  NOINLINE Status(maxint_t x);
   NOINLINE void print(int64_t b, int64_t max_b);
   NOINLINE void print(int64_t low, int64_t limit, maxint_t sum, maxint_t sum_approx);
   static double getPercent(int64_t low, int64_t limit, maxint_t sum, maxint_t sum_approx);
--- include/StatusAC.hpp
@@ -18,9 +18,9 @@ namespace primecount {
 class StatusAC
 {
 public:
-  StatusAC(maxint_t x);
+  NOINLINE StatusAC(maxint_t x);
   NOINLINE void print(int64_t b, int64_t max_b);
-  NOINLINE void next();
+  void next();
 private:
   bool isPrint(double time);
   void print(double percent);
--- include/primecount-internal.hpp
@@ -2,7 +2,7 @@
 /// @file  primecount-internal.hpp
 /// @brief primecount internal functions
 ///
-/// Copyright (C) 2019 Kim Walisch, <kim.walisch@gmail.com>
+/// Copyright (C) 2020 Kim Walisch, <kim.walisch@gmail.com>
 ///
 /// This file is distributed under the BSD License. See the COPYING
 /// file in the top level directory.
@@ -12,6 +12,7 @@
 #define PRIMECOUNT_INTERNAL_HPP

 #include <int128_t.hpp>
+#include <noinline.hpp>

 #include <stdint.h>
 #include <algorithm>
@@ -38,7 +39,6 @@ int64_t pi_lmo5(int64_t x);
 int64_t pi_lmo_parallel(int64_t x, int threads);
 int64_t pi_meissel(int64_t x, int threads);
 int64_t pi_primesieve(int64_t x);
-int64_t pi_simple(int64_t x, int threads);

 int64_t nth_prime(int64_t n, int threads);
 int64_t phi(int64_t x, int64_t a, int threads);
@@ -51,6 +51,12 @@ int64_t Li_inverse(int64_t);
 int64_t Ri(int64_t);
 int64_t Ri_inverse(int64_t);

+// In order to get the best performance with link time
+// optimization only functions should be inlined that are
+// called inside hot loops. This function is only used
+// for initialization and should hence not be inlined.
+NOINLINE int64_t pi_simple(int64_t x, int threads);
+
 #ifdef HAVE_INT128_T

 int128_t pi(int128_t x);
